function is_user()
{
	global $password;
	if ($password === '') return true; 
	if ($_GET['act'] == 'out')
	{
		setcookie('X-Manager', '', -1);
		$url = basename(__FILE__);
		$url = str_replace('\\','/',path());
		$url = str_replace($_SERVER['DOCUMENT_ROOT'],'',$url);
		$url = 'http://'.$_SERVER['HTTP_HOST'].$url;
		go($url);
	}
	if ($_COOKIE['X-Manager'] == md5($password)) return true;
	login();
	exit;
}


function login()
{
	global $password;
	if ($_REQUEST['login'] == $password)
	{
		setcookie('X-Manager',md5($password),time()+12*3600);
		go($_SERVER['REQUEST_URI']);
	}
	echo "<html><head><title>Login to X-Man</title></head>\r\n";
	echo "<body style=\"background:url(data:image/jpg;base64,)
	rgb(247, 252, 246) no-repeat bottom center;color:black;margin:auto;height:85%;width:70%;\"><center><form style=\"margin-top:10%;\" method=\"post\">\r\n";
	echo "<input name=\"login\" type=\"password\" placeholder=\"You'r password\" style=\"background:none;\"/>\r\n";
	echo "<input type=\"submit\" style=\"background:none\" value=\"Login\"/>\r\n"; 
	echo "</form></center></body>\r\n";
	echo "</html>";
}

function zipExtract ($src, $dest)
{
	$zip = new ZipArchive();
	if ($zip->open($src)===true)
	{
		$zip->extractTo($dest);
		$zip->close();
	return true;
	}
	return false;
}

function rmdirs($dir)
{
	$dir = substr($dir,-1) == '/' ? $dir : "$dir/";
	$dirs = opendir($dir);
	if ($dirs)
	while ( false !== ($file = readdir($dirs)))
	if ($file != '.' && $file != '..') 
	if (is_dir($dir.$file)) 
	{ rmdirs($dir.$file); rmdir($dir.$file); }
	else
	 unlink($dir.$file);
	closedir($dirs);
}

function path()
{
	return realpath($_GET['dir'] ? $_GET['dir'] : '.');
}

function paths()
{
	return realpath($_GET['dir'] ? $_GET['dir'] : '.') . "/";
}
	
function go($url)
{
	header("location: $url");
	exit;
}

function srv($x="HTTP_HOST")
{
	return $_SERVER[$x];
